import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button value="view My Bookshelf" />

        <img src={logo} className="App-logo" alt="logo" />
        <p>Welcome Back</p>
        <input type="text" />
      </header>
    </div>
  );
}

export default App;
